import { useImmer } from "use-immer";

const Addqn = (props) =>{
    const [quickNoteText,setQuickNoteText] = useState('52');
    return(<div>
      <input className='AddqnInput font' value={quickNoteText} onChange={e=>{setQuickNoteText(e.target.value)}}></input>
      <button className='AddqnBut font' onClick={props.createQuickNote(quickNoteText)}>+</button>
    </div>)
}

export default Addqn
